def handle_exception(self):
    """Handles the current exception, printing a message to stderr as appropriate.
    It will reraise the exception if necessary (eg if bail is true)"""
    eclass, eval, etb = sys.exc_info()

    if isinstance(eval, SystemExit):
        eval._handle_exception_saw_this = True
        raise

    if not getattr(eval, "_handle_exception_saw_this", False):
        self._out_colour()
        self.write(self.stderr, self.colour.error)

        if isinstance(eval, KeyboardInterrupt):
            self.handle_interrupt()
            text = "Interrupted"
        else:
            text = str(eval)

        if not text.strip():
            text = "(Exception)"

        if not text.endswith("\n"):
            text = text + "\n"

        if len(self._input_descriptions):
            for i in range(len(self._input_descriptions)):
                if i == 0:
                    pref = "At "
                else:
                    pref = " " * i + "From "
                self.write(self.stderr, pref + self._input_descriptions[i] + "\n")

        self.write(self.stderr, text)
        if self.exceptions:
            stack = []
            while etb:
                stack.append(etb.tb_frame)
                etb = etb.tb_next

            for frame in stack:
                self.write(
                    self.stderr,
                    "\nFrame %s in %s at line %d\n"
                    % (frame.f_code.co_name, frame.f_code.co_filename, frame.f_lineno),
                )
                vars = list(frame.f_locals.items())
                vars.sort()
                for k, v in vars:
                    try:
                        v = repr(v)[:80]
                    except Exception:
                        v = "<Unable to convert to string>"
                    self.write(self.stderr, "%10s = %s\n" % (k, v))
            self.write(self.stderr, "\n%s: %s\n" % (eclass, repr(eval)))

        self.write(self.stderr, self.colour.error_)

    eval._handle_exception_saw_this = True
    if self.bail:
        raise

def download(self, url, text=False, checksum=True):
    import urllib.request

    urlopen = urllib.request.urlopen
    import io

    bytesio = io.BytesIO

    write("    Fetching", url)
    count = 0
    while True:
        try:
            if count:
                write("        Try #", str(count + 1))
            try:
                page = urlopen(url).read()
            except:
                # Degrade to http if https is not supported
                e = sys.exc_info()[1]
                if count >= 4 and url.startswith("https:"):
                    write("        [Python has https issues? - using http instead]")
                    page = urlopen(url.replace("https://", "http://")).read()
                else:
                    raise
            break
        except:
            write("       Error ", str(sys.exc_info()[1]))
            time.sleep(3.14 * count)
            count += 1
            if count >= 10:
                raise

    if text:
        page = page.decode("iso8859_1")

    if checksum:
        self.verifyurl(url, page)

    if not text:
        page = bytesio(page)

    return page
